import React from "react";

function SignIn(props) {
  return (
    <div className="SignIn">
      <div>
        <button
          onClick={() => {
            props.setOpenSignIn(false);
          }}
        >
          X
        </button>
      </div>
    </div>
  );
}

export default SignIn;
